import React from 'react'
import {Button, Drawer} from '@material-ui/core'
import {useStoreModel} from '../../ModelAction/useStore'
import {orderTypeEnum, orderTypeLabel, productListModel} from './[id]'
import styled from 'styled-components'
import { ls } from '../../tools/dealKey'
import {grey} from '@material-ui/core/colors'

const Contain = styled.div`
  width: 70vw;
  > header {
    padding: 30px 20px 20px;
    border-bottom: 1px solid ${grey[200]};
  }
  
`

export const SortDrawer = () => {
  const {actions: actionsProductList, state: stateProductList} = useStoreModel(productListModel)

  return <Drawer
      open={stateProductList.sortShow}
      onClose={actionsProductList.closeSort}
  >
    <Contain>
      <header>{ls('排序')}</header>
      <main>
        {Object.keys(orderTypeEnum).map(v => <section
            key={`orderTypeEnum_${v}`}
        >{orderTypeLabel[v]}</section>)}
      </main>
      <footer>
        <Button>确定</Button>
      </footer>
    </Contain>
  </Drawer>
}
